t// The squared radius of the cylinder\nvarying float cylinder_length;\t\t\t// The length of the cylinder\n\nconst float cone_ratio = 1.8; // Ratio of height to radius of arrow head code.\n\nvoid main()\n{\n    // Forward cylinder colors to fragment shader.\n    color1_fs = color1;\n    color2_fs = color2;\n\n    float arrowHeadRadius = radius * 2.5;\n    float arrowHeadLength = cone_ratio * arrowHeadRadius;\n\n    // Reduce original cylinder height to arrow tail length.\n    vec3 vpos = position;\n\n    vec3 arrow_axis = head - base;\n    float len = length(arrow_axis);\n    if(len != 0.0) {\n        if(arrowHeadLength > len)\n            arrowHeadLength = len;\n        vpos -= arrow_axis * (arrowHeadLength / len * dot(position - base, arrow_axis) / dot(arrow_axis, arrow_axis));\n        arrow_axis *= (1.0 - arrowHeadLength / len);\n    }\n\n    // Apply model-view-projection matrix to box vertex position.\n    gl_Position = projectionMatrix * modelViewMatrix * vec4(vpos, 1.0);\n\n    // Apply additional scaling to cylinder radius due to model-view transformation. \n    float viewspace_radius = radius * length(modelViewMatrix[0]);\n\n\t// Pass square of cylinder radius to fragment shader.\n\tcylinder_radius_sq_fs = viewspace_radius * viewspace_radius;\n\n\t// Transform cylinder to eye coordinates.\n\tcylinder_view_base = (modelViewMatrix * vec4(base, 1.0)).xyz;\n\tcylinder_view_axis = (modelViewMatrix * vec4(arrow_axis, 0.0)).xyz;\n\n\t// Pass cylinder length to fragment shader.\n\tcylinder_length = length(cylinder_view_axis);\n\n    raycasting_vertex();\n}'},293:e=>{e.exports='////////////////////////////////////////////////////////////////////////////////////////\n//\n//  Copyright 2022 OVITO GmbH, Germany\n//\n//  This file is part of OVITO (Open Visualization Tool).\n//\n//  OVITO is free software; you can redistribute it and/or modify it either under the\n//  terms of the GNU General Public License version 3 as published by the Free Software\n//  Foundation (t