////////////////////////////////////////\n\nconst float ambient = 0.4;\nconst float diffuse_strength = 1.0 - ambient;\nconst float shininess = 6.0;\nconst vec3 specular_lightdir = normalize(vec3(-1.8, 1.5, -0.2));\n\nvoid outputShadedRay(in vec4 color, in vec3 surface_normal, in vec3 ray_dir)\n{\n    float specular = pow(max(0.0, dot(reflect(specular_lightdir, surface_normal), ray_dir)), shininess) * 0.25;\n    float diffuse = abs(surface_normal.z) * diffuse_strength;\n    gl_FragColor = vec4(color.rgb * (diffuse + ambient) + vec3(specular), color.a);\n}\n\nvoid outputShadedRayAndDepth(in vec4 color, in vec3 surface_normal, in vec3 ray_dir, in float zdepth)\n{\n    outputShadedRay(color, surface_normal, ray_dir);\n    gl_FragDepth = zdepth;\n}\n\nvoid outputFlat(in vec4 color)\n{\n    gl_FragColor = color;\n}\n////////////////////////////////////////////////////////////////////////////////////////\n//\n//  Copyright 2022 OVITO GmbH, Germany\n//\n//  This file is part of OVITO (Open Visualization Tool).\n//\n//  OVITO is free software; you can redistribute it and/or modify it either under the\n//  terms of the GNU General Public License version 3 as published by the Free Software\n//  Foundation (the "GPL") or, at your option, under the terms of the MIT License.\n//  If you do not alter this notice, a recipient may use your version of this\n//  file under either the GPL or the MIT License.\n//\n//  You should have received a copy of the GPL along with this program in a\n//  file LICENSE.GPL.txt.  You should have received a copy of the MIT License along\n//  with this program in a file LICENSE.MIT.txt\n//\n//  This software is distributed on an "AS IS" basis, WITHOUT WARRANTY OF ANY KIND,\n//  either express or implied. See the GPL or the MIT License for the specific language\n//  governing rights and limitations.\n//\n////////////////////////////////////////////////////////////////////////////////////////\n\nuniform mat4 projectionMatrix;\n\nvarying vec3 ray_origin;\nvarying vec3 ray_dir;\n\nvec3 raycasting_fragment()\n{\n    return normalize(ray_dir.xyz / gl_FragCoord.w);\n}\n\n\nvarying vec4 color_fs;\nvarying vec3 particle_view_pos_fs;\nvarying float radius_squared;\n\nvoid main() \n{\n    vec3 ray_dir_norm = raycasting_fragment();\n    vec3 sphere_dir = particle_view_pos_fs - ray_origin;\n\n    // Perform ray-sphere intersection test.\n    float b = dot(ray_dir_norm, sphere_dir);\n    vec3 delta = ray_dir_norm * b - sphere_dir;\n    float x = dot(delta, delta);\n    float disc = radius_squared - x;\n\n\tfloat afwidth = fwidth(disc);\n\tfloat alpha = smoothstep(0.0, afwidth, disc);\n    if(disc <= 0.0)\n        discard; // Ray missed sphere entirely, discard fragment\n\n    // Calculate closest intersection position.\n    float tnear = b - sqrt(disc);\n\n    // Discard intersections located behind the viewer.\n//    if(tnear < 0.0)\n//        discard;\n\n    // Calculate intersection point in view coordinate system.\n    vec3 view_intersection_pnt = ray_origin + tnear * ray_dir_norm;\n\n    // Output the ray-sphere intersection point as the fragment depth\n    // rather than the depth of the bounding box polygons.\n    // The eye coordinate Z value must be transformed to normalized device\n    // coordinates before being assigned as the final fragment depth.\n    vec4 projected_intersection = projectionMatrix * vec4(view_intersection_pnt, 1.0);\n    float fragDepth = (projected_intersection.z / projected_intersection.w + 1.0) * 0.5;\n\n    // Calculate surface normal in view coordinate system.\n    vec3 surface_normal = normalize(view_intersection_pnt - particle_view_pos_fs);\n    outputShadedRayAndDepth(vec4(color_fs.rgb, alpha), surface_normal, ray_dir_norm, fragDepth);\n}'},798:e=>{e.exports='////////////////////////////////////////////////////////////////////////////////////////\n//\n//  Copyright 2022 OVITO GmbH, Germany\n//\n//  This file is part of OVITO (Open Visualization Tool).\n//\n//  OVITO is free software; you 